import re

commandr = '\s*([a-zA-Z])\s*'
num = '(?:[-+]?)\d+(?:\.\d+)?'

def _assert(foo):
    if not foo:
        import pdb; pdb.set_trace()
        assert(foo)


while d_string:
    commandmatch = re.match(f"{commandr}(.*)", d_string)
    _assert(commandmatch)
    command = commandmatch.group(1)
    d_string = commandmatch.group(2)
    if command == 'c':
        out = "c "
        for i in range(0,3):
            pointmatch = re.match(f"(\s*{num},{num})(.*)", d_string)
